  `ORI_MSG` json DEFAULT NULL COMMENT '通知内容',
  `NOTIFY_LOGS` json DEFAULT NULL COMMENT '通知日志',
  PRIMARY KEY (`ID`,`CREATE_TIME`),
  KEY `idx_mch_no` (`MCH_NO`),
  KEY `idx_trx_no` (`TRX_NO`),
  KEY `idx_mch_trx_no` (`MCH_TRX_NO`)
) ENGINE=InnoDB AUTO_INCREMENT=85 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='商户通知表'
